import React, {Component} from 'react';
import './Nav.css';

class Nav extends Component {
    render() {
        return (
            <div className='nav'>
                <div className='leftNav'>
                    <p>Spotaroom</p>
                </div>
                <div className='rightNav'>
                    <p>The company - How we work - <a href='https://www.spotahome.com/about-us'>About us</a>
                    </p>
                </div>
            </div>
        );
    }
}

export default Nav;
